import MainContent from './componenst/MainContent';
import data from './componenst/data';
import './App.css';


function App() {


  const sisu = data.map(it => {
    return (
      <MainContent
        name={data.name}
        text={data.text}
        date={data.date}
        data={data}
        img={data.img}
      />
    )
  })


  return (
    <div className="App">
      {sisu}


    </div>
  );
}

export default App;
